      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        id: id,
        message: "withdrawal was successfully approved",
      }),
    }).then(function (res) {
      if (res.ok) {
        message.success("withdrawal was successfully approved");
      } else message.error("withdrawal approval was not successfull");
      (async () => {
        let response = await fetch(
          `https://bridgegatebackend.herokuapp.com/api/trade/user/${this.state.user.user.user._id}`
        );
        let user = await response.json();
        this.setState({
          user: user,
        });

        let a = { user: user };
        localStorage.setItem("user", JSON.stringify(a));
      })();
    });
  };

  declineDeposit = (id) => {
