      }),
    }).then(function (res) {
      if (res.ok) {
        message.success("deposit was successfully approved");
      } else message.error("deposit approval was not successfull");
      (async () => {
        let response = await fetch(
          `https://bridgegatebackend.herokuapp.com/api/trade/user/${this.state.user.user.user._id}`
        );
        let user = await response.json();
        this.setState({
          user: user,
        });

        let a = { user: user };
        localStorage.setItem("user", JSON.stringify(a));
      })();
    });
  };
  makeAdmin = (id) => {
    fetch(`https://bridgegatebackend.herokuapp.com/api/users/makeAdmin`, {
      mode: "cors",
      method: "PUT",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      body: JSON.stringify({ id: id }),
    }).then(function (res) {
      if (res.ok) {
        message.success("successfully made an Admin");
      } else message.error("error making an Admin");
    });
  };

  makeManager = (id) => {
    fetch(`https://bridgegatebackend.herokuapp.com/api/users/makeManager`, {
      mode: "cors",
      method: "PUT",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      body: JSON.stringify({ id: id }),
    }).then(function (res) {
      if (res.ok) {
        message.success("successfully made a Manager");
      } else message.error("error making Manager");
    });
  };

  removeManager = (id) => {
    fetch(`https://bridgegatebackend.herokuapp.com/api/users/removeManager`, {
      mode: "cors",
      method: "PUT",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      body: JSON.stringify({ id: id }),
    }).then(function (res) {
      if (res.ok) {
        message.success("successfully removed as a Manager");
      } else message.error("error removing Manager");
    });
  };

  removeAdmin = (id) => {
    fetch(`https://bridgegatebackend.herokuapp.com/api/users/removeAdmin`, {
      mode: "cors",
      method: "PUT",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      body: JSON.stringify({ id: id }),
    }).then(function (res) {
      if (res.ok) {
        message.success("successfully removed as a Admin");
      } else message.error("error removing as an Admin");
    });
  };

  deleteUser = (id) => {
    fetch(`https://bridgegatebackend.herokuapp.com/api/users/remove`, {
      mode: "cors",
      method: "DELETE",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      body: JSON.stringify({ id: id }),
    }).then(function (res) {
      if (res.ok) {
        message.success("User was successfully deleted from the database");
